import React, { Component } from "react";

class Hi extends Component {
  state = {};
  render() {
    return (
      <div>
        <section id="hello" class="container section">
          <div class="row">
            <div class="col-md-10">
              <h1
                id="hello_header"
                class="section__title"
                style={{textIndent: "0px"}}
              >
                Hi_
              </h1>
              <p class="section__description">
                I am Junior Web developer able to build a Web presence from the
                ground up - from concept, navigation, layout and programming to
                UX and SEO. Skilled at writing well-designed, testable and
                efficient code using current best practices in Web development.
                Fast learner, hard worker and team player who is proficient in
                an array of scripting languages and multimedia Web tools.
              </p>
              <a href="" class="section_btn site-btn">
                <img src="assets/img/img_btn_icon.png" alt=""></img>Download CV
              </a>
            </div>
          </div>
        </section>
      </div>
    );
  }
}

export default Hi;
